import React from "react";
import { NavLink } from "react-router-dom";
import Common from "./Common";
import img from "./image/start-ups.svg";

const Home = () => {
  return (
    <>
      <Common
        name=" We are the team of talented developer making websites"
        img={img}
      />
    </>
  );
};

export default Home;
